import React from "react";
import {} from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import NavBar from "./Navbar";

class Profile extends React.Component {
  render() {
    return (
      <div>
        <NavBar />
        <Container fluid>
          <Row>
            <Col sm={4}>Hello</Col>
            <Col sm={8}>World</Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Profile;
